package org.java.Strings;

public class compareToInString {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		  String obj1="java";
		  String obj2="java";
		  String obj3="html";
		  String obj4="pankaj";
		  System.out.println(obj1.compareTo(obj2));
		  System.out.println(obj2.compareTo(obj3));
		  System.out.println(obj2.compareTo(obj3));
		  System.out.println(obj2.compareTo(obj4));
	}

}
